import React, { useState } from 'react';
import sunoService, { getStreamingCategories, getCategoryDisplayName } from '../services/sunoService';
import { StreamingTrack } from '../types/track';
import authService from '../services/authService';

type SunoGeneratorProps = {
  onTracksGenerated: (tracks: StreamingTrack[]) => void;
};

const SunoGenerator: React.FC<SunoGeneratorProps> = ({ onTracksGenerated }) => {
  const categories = getStreamingCategories();
  const [category, setCategory] = useState<string>(categories[0] || 'chill_gaming');
  const [count, setCount] = useState<number>(3);
  const [isGenerating, setIsGenerating] = useState<boolean>(false);
  const [error, setError] = useState<string | null>(null);

  // Check if user has access to Suno generation
  const featureFlags = authService.getFeatureFlags();
  if (!featureFlags?.canGenerateSuno) {
    return (
      <div className="p-4 bg-red-900/30 border border-red-600 rounded-2xl text-center">
        <div className="flex items-center justify-center space-x-2 mb-3">
          <span className="text-red-400 text-lg">ðŸ”’</span>
          <h3 className="text-red-200 font-semibold">AI Generation Restricted</h3>
        </div>
        <p className="text-red-300 text-sm">
          Upgrade to Pro plan or Agency plan to access AI music generation.
        </p>
      </div>
    );
  }

  const createDemoTracks = (cat: string, howMany: number): StreamingTrack[] => {
    const demoSources = ['/tracks/track1.mp3', '/tracks/track2.mp3', '/tracks/track3.mp3'];
    const moods = ['chill', 'energetic', 'epic'];
    const genres = ['ambient', 'electronic', 'orchestral'];
    const tracks: StreamingTrack[] = [];
    for (let i = 0; i < howMany; i++) {
      const idSuffix = Math.random().toString(36).slice(2, 8);
      const src = demoSources[i % demoSources.length];
      const mood = moods[i % moods.length];
      const genre = genres[i % genres.length];
      tracks.push({
        id: `demo_${cat}_${idSuffix}`,
        title: `${getCategoryDisplayName(cat)} - Demo ${i + 1}`,
        artist: 'Demo Track',
        duration: 180,
        audioUrl: src,
        category: 'gaming',
        subcategory: 'ambient',
        mood,
        energy: 3,
        tags: [cat, mood, genre],
        streamSafe: true,
        loopFriendly: true,
        hasIntro: false,
        hasOutro: false,
        uploadDate: new Date().toISOString(),
        uploadedBy: 'system',
        approved: true,
        sunoId: `demo_${idSuffix}`,
        streamingCategory: cat,
        genre,
        energyLevel: 'medium',
        dmcaSafe: true,
        vodSafe: true,
        license: 'royalty_free',
        licenseDetails: 'Demo track',
        platformCompliance: { twitch: 'safe', youtube: 'safe', facebook: 'safe', tiktok: 'safe' },
        usageTracking: { usageCount: 0 },
        agencyNotes: 'Demo generated track'
      });
    }
    return tracks;
  };

  const handleGenerate = async () => {
    setIsGenerating(true);
    setError(null);
    try {
      if (sunoService.isDemoMode()) {
        const demo = createDemoTracks(category, count);
        onTracksGenerated(demo);
      } else {
        // Real generation via Suno API
        const generated = await sunoService.generateTracksForCategory(category, count);
        onTracksGenerated(generated);
      }
    } catch (e) {
      setError(e instanceof Error ? e.message : 'Generation failed');
    } finally {
      setIsGenerating(false);
    }
  };

  return (
    <div className="p-4 bg-gray-800/50 border border-gray-600 rounded-2xl space-y-4">
      <div className="flex items-center justify-between">
        <h3 className="text-white font-semibold">AI Music Generator</h3>
        <span className="text-xs px-2 py-1 rounded-full border border-gray-600 text-gray-300">
          {sunoService.isDemoMode() ? 'Demo Mode' : 'Live Mode'}
        </span>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-3">
        <div>
          <label className="block text-xs text-gray-400 mb-1">Category</label>
          <select
            value={category}
            onChange={(e) => setCategory(e.target.value)}
            className="w-full px-3 py-2 bg-gray-800 border border-gray-600 rounded-xl text-white focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            {categories.map((c) => (
              <option key={c} value={c} className="bg-gray-800 text-white">
                {getCategoryDisplayName(c)}
              </option>
            ))}
          </select>
        </div>

        <div>
          <label className="block text-xs text-gray-400 mb-1">Tracks</label>
          <input
            type="number"
            min={1}
            max={10}
            value={count}
            onChange={(e) => setCount(Math.max(1, Math.min(10, Number(e.target.value))))}
            className="w-full px-3 py-2 bg-gray-800 border border-gray-600 rounded-xl text-white focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        <div className="flex items-end">
          <button
            onClick={handleGenerate}
            disabled={isGenerating}
            className={`w-full px-4 py-2 rounded-xl text-white transition-colors ${
              isGenerating ? 'bg-purple-900 cursor-not-allowed' : 'bg-purple-600 hover:bg-purple-700'
            }`}
          >
            {isGenerating ? 'Generatingâ€¦' : 'Generate'}
          </button>
        </div>
      </div>

      {error && (
        <div className="p-2 text-sm text-red-300 bg-red-900/40 border border-red-700 rounded-xl">
          {error}
        </div>
      )}

      <p className="text-xs text-gray-400">
        Generated tracks will be added to your library automatically.
      </p>
    </div>
  );
};

export default SunoGenerator;
